$this->insert('{{%c_documentation}}',['content_id'=>'198','content'=>'

All Organizations are classified into 4 differnt groups

1. EnterPrise Organization

2. Legal Organization

3. Business Organization

4. Inventory Organization

 

1. EnterPrise Organization

Enterrpise is the higest level in the organization hirearhcy. The corporate HQs are usually reprsented by Enterprise.

Ex : inoERP Corp

Enterprise Organization is the organization which is responsible for all the child legal organizations, JVs in differnt countries.

2. Legal Organization

An legal organization is a specific country registered as per the company law of that country. Legal organizations are resposible for maintaing all the statutory requirements in their respective countires. Legal Orgs own employees, assets and responsible for the ownership of the business activities.

Ex : inoERP SPG, inoERP UK, inoERP IND all reporting to inoERP Corp

 

3. Business Organization

Business organizations are reponsible for daily operational activites. All the extarnal entities such as suppliers, customers directly work with business organizations.

Ex : inoERP SPG - Electronics Division, inoERP SPG - HiTech Division

 

4. Inventory Organization

Business organizations are reponsible for daily operational activites. All the extarnal entities such as suppliers, customers directly work with business organizations.

Ex : inoERP SPG - Electronics Division, inoERP SPG - HiTech Division

 

 
