$this->insert('{{%c_documentation}}',['content_id'=>'240','content'=>'

All Inventory & non-inventory items are managed in item master sub module of inventory module. Inventory items are those which exist physically where as non-inventory items are defined primarily for sales & purchasing activates but not tracked as on hand inventory.

Examples of non-inventory items are services, warranty & subscriptions.

Item Attributes

Item attributes are item related information that you need to enter in the system for tracking & transaction purposes. All the item attributes are grouped into different modules /sub-modules in the item master form for easy data entry.

\"\"

inoERP has many seeded (150+) item attributes used standard businesses, and it also allows you create new attributes through an extra field functionality. Extra fields can be used for any business specific important field that’s not seeded in inoERP. Once defined and implemented, extra fields looks and behave in the same way as any other seeded attribute field.

You use the Item Master form to add, update, search, and maintain item data. 
Item master form allows any number of file attachments.
Item master form allows any number of notes entry.

Item master navigation 
You can access item master through system menu or from dashboard
1. System Menu 
2. Roll mouse over INV
3. Click on Item Master
Or,
1. Dashboard 
2. Click on Inventory
3.Click on Item Master. 

 
